webpackJsonp([0xd9a22e1d6a17],{5229:function(e,a){e.exports={data:{post:{html:"<p>Europe went on Daylight Savings Time today, in case you're wondering what we're doing up so early. North America starts next weekend, right?</p>\n<p>It's still awfully cold, though. Mid-30's and freezing rain. Yech!</p>\n<p>Considering I was half sick yesterday, I got a lot done. (Mama was full sick,so she couldn't help.) I fixed the lock on our mailbox (after 6 months), so we again comply with German postal secrecy and require at least a good screwdriver to break in (which is how we broke the original lock). And I hung a curtain in Christopher's bedroom in preparation for longer daylight. After all, the longer he sleeps, the longer we sleep.</p>",fields:{title:"Strange fear I ain't felt for years",date:"25 Mar 2001",url:"https://papascott.de/2001-03-25-strange-fear-i-aint-felt-for-years/"}}},pathContext:{slug:"/2001-03-25-strange-fear-i-aint-felt-for-years/",prev:{fields:{title:"Gotta walk for air",date:"24 Mar 2001",slug:"/2001-03-24-gotta-walk-for-air/"}},next:{fields:{title:"The boy's coming and I'm close to tears",date:"26 Mar 2001",slug:"/2001-03-26-the-boys-coming-and-im-close-to-tears/"}}}}}});
